    <p>{`On this page, we explain step by step how to run `}<strong parentName="p">{`CloudPanel`}</strong>{` on the `}<a parentName="p" {...{
        "href": "https://cloud.google.com"
      }}>{`Google Cloud`}</a>{`.`}</p>
    <h2 {...{
      "id": "launching-a-vm-instance"
    }}>{`Launching a VM Instance`}</h2>
    <p>{`1) Login into the `}<a parentName="p" {...{
        "href": "https://console.cloud.google.com/"
      }}>{`Google Cloud Console`}</a>{`.`}</p>
    <p>{`2) Click in the left navigation on `}<strong parentName="p">{`Compute Engine`}</strong>{` --> `}<strong parentName="p">{`VM instances`}</strong>{` and click on the button `}<strong parentName="p">{`Create`}</strong>{`.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/vm_instance.png')} />
    <h3 {...{
      "id": "name-and-region"
    }}>{`Name and Region`}</h3>
    <p>{`Enter the `}<strong parentName="p">{`Name`}</strong>{` of the instance and select a `}<strong parentName="p">{`Region`}</strong>{` to deploy.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/vm_name_region.png')} />
    <h3 {...{
      "id": "machine-configuration"
    }}>{`Machine Configuration`}</h3>
    <p>{`Select the `}<strong parentName="p">{`Machine Family`}</strong>{`, `}<strong parentName="p">{`Series`}</strong>{` and `}<strong parentName="p">{`Machine Type`}</strong>{`.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/machine_configuration.png')} />
    <h3 {...{
      "id": "boot-disk"
    }}>{`Boot Disk`}</h3>
    <p>{`Use `}<strong parentName="p">{`Debian 10 (Buster)`}</strong>{` as `}<strong parentName="p">{`Boot disk`}</strong>{` image.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/boot_disk_image.png')} />
    <h3 {...{
      "id": "firewall"
    }}>{`Firewall`}</h3>
    <p>{`1) Allow `}<strong parentName="p">{`HTTP`}</strong>{` and `}<strong parentName="p">{`HTTPS`}</strong>{` Traffic.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/allow_http_https_traffic.png')} /> <br /> <br />
    <p>{`2) Click on `}<strong parentName="p">{`Management, security, disks, networking, sole tenancy`}</strong>{` to continue with the next step.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/management_security_disk_settings.png')} /> <br /> <br />
    <p>{`3) Click on the tab `}<strong parentName="p">{`Security`}</strong>{` and enter your `}<a parentName="p" {...{
        "href": "https://cloud.google.com/compute/docs/instances/adding-removing-ssh-keys#createsshkeys"
      }}>{`Public SSH Key`}</a>{`.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/public_ssh_key.png')} /> 
    <h3 {...{
      "id": "networking"
    }}>{`Networking`}</h3>
    <p>{`In the `}<strong parentName="p">{`Networking`}</strong>{` section we will add a `}<strong parentName="p">{`Network Tag`}</strong>{` and create a `}<strong parentName="p">{`Static IP Address`}</strong>{` for our instance.`}</p>
    <p>{`1) In the field `}<strong parentName="p">{`Network tags`}</strong>{` add the tag: `}<strong parentName="p">{`cloudpanel`}</strong>{`. `}<br />{`
The `}<strong parentName="p">{`Network Tag`}</strong>{` is needed for assigning `}<strong parentName="p">{`Firewall Rules`}</strong>{` to our instance.`}</p>
    <p>{`2) In the `}<strong parentName="p">{`Network interface`}</strong>{` settings click on `}<strong parentName="p">{`External IP`}</strong>{` --> `}<strong parentName="p">{`Create IP address`}</strong>{` to create a static IP address.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/networking_network_tag_static_ip_address.png')} /> <br /> <br />
    <h3 {...{
      "id": "create"
    }}>{`Create`}</h3>
    <p>{`Click on the button `}<strong parentName="p">{`Create`}</strong>{` to launch the `}<strong parentName="p">{`VM Instance`}</strong>{`.`}</p>
    <h2 {...{
      "id": "firewall-rules"
    }}>{`Firewall Rules`}</h2>
    <p>{`For accessing the `}<strong parentName="p">{`CloudPanel`}</strong>{` later, we need to create a `}<strong parentName="p">{`Firewall Rule`}</strong>{`.`}</p>
    <p>{`1) Click in the left navigation on `}<strong parentName="p">{`Networking`}</strong>{` -> `}<strong parentName="p">{`VPC Network`}</strong>{` -> `}<strong parentName="p">{`Firewall`}</strong>{`.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/vpc_network_firewall_rules.png?v=1')} /> <br /><br />
    <p>{`2) Click on the button `}<strong parentName="p">{`CREATE FIREWALL RULE`}</strong>{` and create the following rule:`}</p>
    <p><strong parentName="p">{`Name:`}</strong>{` allow-cloudpanel `}<br />{`
`}<strong parentName="p">{`Targets:`}</strong>{` Specified target tags `}<br />{`
`}<strong parentName="p">{`Target tags:`}</strong>{` cloudpanel `}<br />{`
`}<strong parentName="p">{`Source filter:`}</strong>{` IP ranges `}<br />{`
`}<strong parentName="p">{`Source IP ranges:`}</strong>{` 0.0.0.0/0 or `}<strong parentName="p">{`your IP`}</strong>{` if you have a fixed IP `}<br />{`
`}<strong parentName="p">{`Protocols and ports:`}</strong>{` tcp: 8443 `}<br /></p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/cloudpanel_firewall_rule.png')} />
    <h2 {...{
      "id": "cloudpanel-installation"
    }}>{`CloudPanel Installation`}</h2>
    <h3 {...{
      "id": "ssh-login"
    }}>{`SSH Login`}</h3>
    <p>{`For installing `}<strong parentName="p">{`CloudPanel`}</strong>{`, we first need to login with `}<strong parentName="p">{`SSH`}</strong>{`. `}<br /></p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`ssh -i path_to_your_private_key username@staticIpAddress
`}</code></pre>
    <p>{`The `}<strong parentName="p">{`username`}</strong>{` can be found at the end of your `}<strong parentName="p">{`Public SSH Key`}</strong>{`. `}<br />{`
In the following example, the `}<strong parentName="p">{`username`}</strong>{` would be `}<strong parentName="p">{`john`}</strong>{`.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`ssh-rsa AAAAB3NzaC1yc2EAAAADAQABAAABAQDjC22YtN9qsN/F1piw5FHtG3RqXjHhI5CdHIpmN
pQ1LeXRmODsfzv4pntYeGw0dfBFidlmxujNLyd8FMZ8Yida5zcciWkLvqAAkTlwCAWNg/kdJI0R4B
wuSgYUjxgOU5LPYkm4MixSOvC+jI27Ge0nKMiqUaJoSrYfNJqraMNuikNrwQn+I7w3var2aebhQtR
77Lx1dHoAF/pP9DIFYfzFZ7CsQc8pBXj3 john@macbook
`}</code></pre>
    <div {...{
      "className": "admonition admonition-warning alert alert--danger"
    }}><div parentName="div" {...{
