              }}></path></svg></span>{`warning`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Do not use the username `}<strong parentName="p">{`cloudpanel`}</strong>{` as it's a reserved one.`}</p></div></div>
    <p>{`The `}<strong parentName="p">{`static IP Address`}</strong>{` can be found on the VM instances overview, it's called `}<strong parentName="p">{`External IP`}</strong>{`.`}</p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/gce_installation/static_ip.png')} /> <br /> <br />
    <h3 {...{
      "id": "installer"
    }}>{`Installer`}</h3>
    <p>{`Before running the installer, we need to switch the user to `}<strong parentName="p">{`root`}</strong>{` to install the required packages.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`sudo su root
`}</code></pre>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`apt update && apt -y upgrade && apt -y install curl wget sudo
`}</code></pre>
    <p>{`To start the `}<strong parentName="p">{`CloudPanel`}</strong>{` installation, execute the following command:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`curl -sSL https://installer.cloudpanel.io/ce/v1/install.sh | sudo CLOUD=gce bash
`}</code></pre>
    <h2 {...{
      "id": "access-cloudpanel"
    }}>{`Access CloudPanel`}</h2>
    <p>{`You can now access the CloudPanel via Browser: `}<strong parentName="p"><a parentName="strong" {...{
          "href": "https://yourStaticIpAddress:8443"
        }}>{`https://yourStaticIpAddress:8443`}</a></strong></p>
    <img class="border" src={useBaseUrl('img/v1/getting_started/ignore_self_signed_certificate.png')} />
    <p>{`Ignore the self-signed certificate warning and click on `}<strong parentName="p">{`Advanced`}</strong>{` and `}<strong parentName="p">{`Proceed`}</strong>{` to continue to CloudPanel.`}</p>
    </MDXLayout>;
}

